std::string encoder(const Board &b, bool is_white){
    int size = b.data.board_type == SEVEN_THREE ? 7 : 8;
    int numOfPieces = b.data.board_type == EIGHT_TWO ? 10 : 8;
    std::vector<std::vector<std::vector<int>>> position(numOfPieces, std::vector<std::vector<int>>(size, std::vector<int>(size,0)));
    std::map<U8, int> mp;
    mp[WHITE|PAWN] = 0;
    mp[WHITE|ROOK] = 1;
    mp[WHITE|BISHOP] = 2;
    mp[WHITE|KING] = 3;
    mp[WHITE|KNIGHT] = 8;
    mp[BLACK|PAWN] = 4;
    mp[BLACK|ROOK] = 5;
    mp[BLACK|BISHOP] = 6;
    mp[BLACK|KING] = 7;
    mp[BLACK|KNIGHT] = 9;
    U8 *pieces = (U8*)(&(b.data));
    
    for(int i = 0; i<2*b.data.n_pieces;i++){
        if(pieces[i] == DEAD){
            continue;
        }
        int x = size - 1 - gety(pieces[i]);
        int y = getx(pieces[i]);
        if(is_white)
            position[mp[b.data.board_0[pieces[i]]]][x][y] = 1;
        else
            position[mp[b.data.board_0[pieces[i]] ^ (WHITE | BLACK)]][x][y] = 1;
    }
    std::string s = "";
    for(int k = 0; k<numOfPieces;k++){
        for(int i = 0; i<size; i++){
            for(int j = 0; j<size; j++){
                if(is_white)
                    s += std::to_string(position[k][i][j]);
                else
                    s += std::to_string(position[k][size-1-i][size-1-j]);
                s += ",";
            }
        }
    }
    return s;
}

