U16 iddfs(const Board &b, double t, Engine* e)
{
    start_time = chrono::high_resolution_clock::now();
    time_given = t;
    time_up = false;
    double duration = 0;
    int depth  = 2;
    U16 best_move = 0;

    U16 omit_move = 0;
    string s = encoder(b, true);
    double eval = 0;
    e->repitition_table[s].count++;
    if(e->repitition_table[s].count > 2)
    {
        omit_move = e->repitition_table[s].move;
    }
    // else if(e->repitition_table[s].count == 2)
    // {
    //     return e->repitition_table[s].move;
    // }


    while(!time_up)
    {
        auto something = minimax(b, depth, omit_move);
        U16 temp = something.second;
        eval = something.first;
        if(time_up)
        {
            return best_move;
        }
        best_move = temp;

        auto time_now = chrono::high_resolution_clock::now();
        duration = chrono::duration_cast<std::chrono::milliseconds>(time_now - start_time).count();
        if(duration >= time_given)
        {
            time_up = true;
        }

        depth+=2;
    }

    if(e->repitition_table[s].count > 2)
    {
        e->repitition_table[s].count = 0;
        if(abs(eval - e->repitition_table[s].eval) <= 100 && eval >= -100 && e->repitition_table[s].eval >= -100)
        {
            e->repitition_table[s].count = 0;
        }
        else
        {
            best_move = e->repitition_table[s].move;
            eval = e->repitition_table[s].eval;
            e->repitition_table[s].count = 0;
        }
    }

    e->repitition_table[s].move = best_move;
    e->repitition_table[s].eval = eval;

    return best_move;
}

vector<pair<int,U16>> get_moveset(Board &b, U16 omit_move = 0){

    auto moveset = b.get_legal_moves();
    vector<pair<int,U16>> moves;

    for(auto m : moveset)
    {
        if(m==omit_move)
        {
            continue;
        }

        U8 p0 = getp0(m);
        U8 p1 = getp1(m);

        U8* pieces = (U8*)(&(b.data));

        U8 capturing_piece = b.data.board_0[p0];
        U8 captured_piece = 0;
        int score = 0;


        for(int i = 0; i<20;i++){
            if(pieces[i] == p1){
                captured_piece = b.data.board_0[p1];
                break;
            }
        }


        if(captured_piece == 0){
            moves.push_back({0,m});
            continue;
        }


        int piece1 = capturing_piece;
        piece1 = piece1 & (-piece1);
        piece1 = (int)(log2(piece1));

        int p2 = captured_piece;
        p2 = p2 & (-p2);
        p2 = (int)(log2(p2));

        score += 6*p2-piece1;
        if(score<0)
        {
            score = 10;
        }

        moves.push_back({score,m});
    }

    std::sort(moves.rbegin(),moves.rend());
    
    return moves;
}
bool first_move_flag = true;
pair<double, U16> minimax(const Board &b, int depth, U16 omit_move = 0)
{
    Board *temp_b = new Board(b);
    nodes_visited = 0;
    first_move_flag = true;
    auto p = getMax(*temp_b,-1*INFINITY,INFINITY,depth,0,false, omit_move);
    return p;
}

double Qsearch(Board &b, double alpha, double beta){
    auto p = getMax(b,-1*INFINITY,INFINITY,10,0,true,0);
    return p.first;
}

