int trans(U16 move){
    int a = getp0(move);
    int b = getp1(move);
    return a*64+b;
}
vector<pair<int,U16>> captureMoves(Board &b,bool print = false){
    int btype = (int)(b.data.board_type)-1;
    PlayerColor player = b.data.player_to_play;
    vector<pair<int, U16>> legal_captures;
    U8* pieces = (U8*)(&b.data);
    for(int i = 0; i<20;i++){
        U8 piece1 = b.data.board_0[pieces[i]];
        if(pieces[i] == DEAD || (piece1 & (WHITE | BLACK)) != player){
            continue;
        }
        moveScore ms;
        ms.blockDist.resize(9, 50);
        ms.blockMove.resize(9, 0);
        ms.score.resize(9, 0);

        auto piece1type = piece1 & (PAWN | ROOK | BISHOP | KING | KNIGHT);

        for(int j = 0; j<20;j++){
            if(pieces[j] == DEAD){
                continue;
            }
            U8 piece2 = b.data.board_0[pieces[j]];
            if(print){
        }
            auto piece2type = piece2 & (PAWN | ROOK | BISHOP | KING | KNIGHT);
            U16 mv = move(pieces[i],pieces[j]);
            int sc = 6*new_pieceval[type_to_ind[piece2type]] - new_pieceval[type_to_ind[piece1type]];

            auto tmp = trans(mv);
            if((piece1 & (WHITE | BLACK)) == (piece2 & (WHITE | BLACK))){
                mv = 0;
                sc = 0;
            }
            int dist = mp[btype][tmp][type_to_ind[piece1type]].first;
            int dirn = mp[btype][tmp][type_to_ind[piece1type]].second;
            if(dist == -1){
                continue;
            }
            if(ms.blockDist[dirn]>dist){
                ms.blockDist[dirn] = dist;
                ms.blockMove[dirn] = mv;
                ms.score[dirn] = sc;
            }            
        }

        if(true)
        {
            for(int k = 1; k<=8;k++)
            {
                if(ms.blockMove[k]!=0)
                {
                    U16 mm = ms.blockMove[k];
                    b.do_move_without_flip_(ms.blockMove[k]);
                    if(b.in_check())
                    {
                        ms.blockMove[k] = 0;
                    }
                    b.undo_last_move_without_flip_(mm);
                }
            }
        }

        for(int k = 0; k<=8;k++)
        {
            if(ms.blockMove[k]!=0)
            {
                legal_captures.push_back({ms.score[k],ms.blockMove[k]});
            }
        }

    }
    return legal_captures;
}
double Evaluation(const Board &b,bool print = false){
    int btype = (int)(b.data.board_type)-1;
    U8* pieces = (U8*)(&b.data);
    double value = 0.0;
    for(int i = 0; i < 20; i++){
        if(pieces[i] == DEAD){
            continue;
        }
        U8 piece1 = b.data.board_0[pieces[i]];
        auto piece1Color = piece1 & (WHITE | BLACK);
        auto piece1Type = piece1 & (PAWN | ROOK | BISHOP | KING | KNIGHT);
        if(piece1Color == b.data.player_to_play){
            value += new_pieceval[type_to_ind[piece1Type]];
        }else{
            value -= new_pieceval[type_to_ind[piece1Type]];
        }
        if(piece1Type == PAWN){
            U8 posn = pieces[i];
            int pi = posn%8;
            int pj = (sz[btype]-1-posn/8);
            if(piece1Color == BLACK){
                pi = sz[btype]-1-pi;
                pj = sz[btype]-1-pj;
            }
            if(piece1Color == b.data.player_to_play){
                value += pawn_end[btype][pj][pi]*10;
            }else{
                value -= pawn_end[btype][pj][pi]*10;
            }
        }
        double mult = 1.0;
        double score = 0.0;
        vector<vector<pair<int,U8>>> cap(9);
        for(int j = 0; j<20;j++){
            if(pieces[j] == DEAD){
                continue;
            }
            U8 piece2 = b.data.board_0[pieces[j]];
            auto piece2Color = piece2 & (WHITE | BLACK);
            auto piece2Type = piece2 & (PAWN | ROOK | BISHOP | KING | KNIGHT);
            U16 mv = move(pieces[i],pieces[j]);
            int dist = mp[btype][trans(mv)][type_to_ind[piece1Type]].first;
            int dirn = mp[btype][trans(mv)][type_to_ind[piece1Type]].second;
            if(dist == -1){
                continue;
            }
            cap[dirn].push_back({dist,piece2});
        }
        for(auto cp:cap){
            sort(cp.begin(),cp.end());
            for(auto pr:cp){
                if(color(pr.second) == piece1Color){
                    mult *= 0.75;
                }else{
                    score += mult*VAL[type_to_ind[pr.second & (PAWN | ROOK | BISHOP | KING | KNIGHT)]];
                    mult *= 0.95;
                }
            }
        }
        if(piece1Color == b.data.player_to_play){
            value += score;
        }else{
            value -= score;
        }
    }
    return value;
}

pair<double,U16> getMin(Board &b, double alpha, double beta,int depth,U16 move,bool qsearch, U16 omit_move = 0){
    nodes_visited++;

    if(depth == 0){
        if(!qsearch && b.data.last_killed_piece_idx != -1){
            return {std::max(Qsearch(b,alpha,beta),evaluate(b)),0};
        }else{
            return {evaluate(b),0};
        }
    }
    vector<pair<int,U16>> moveset;
    if(qsearch){
        moveset = captureMoves(b);
        if(moveset.size()==0){
            return {-evaluate(b),0};
        }
    }else{
        moveset = get_moveset(b);
    }
    pair<double,U16> v = {20000,0};

    for(auto m:moveset){
        if(time_up)
        {
            return {0.0,0};
        }
        auto time_now = chrono::high_resolution_clock::now();
        double duration = chrono::duration_cast<std::chrono::milliseconds>(time_now - start_time).count();
        if(duration >= time_given)
        {
            time_up = true;
            return {0.0,0};
        }

        Board* tempb = new Board(b);
        tempb->do_move_(m.second);
        int tt = -1;

        pair<double,U16> p = {getMax(*tempb,alpha,beta,depth+tt,m.second,qsearch,0).first,m.second};

        v = min(v,p);
        beta = min(beta,p.first);
        delete(tempb);
        if(alpha>beta){
            return v;
        }
    }

    if(moveset.size()==0)
    {
        if(!b.in_check())
            v.first = 0;
        else{
            v.first = 15000.0;
            v.first += depth*10;
        }
    }

    return v;
}

pair<double,U16> getMax(Board &b, double alpha, double beta,int depth,U16 move,bool qsearch, U16 omit_move = 0){
    nodes_visited++;
    if(depth == 0){
        if(!qsearch && b.data.last_killed_piece_idx != -1){
            return {std::max(Qsearch(b,alpha,beta),evaluate(b)),0};
        }else{
            return {evaluate(b),0};
        }
    }
    vector<pair<int,U16>> moveset;
    if(qsearch){
        moveset = captureMoves(b);

        if(moveset.size()==0){
            return {evaluate(b),0};
        }
    }else{
        moveset = get_moveset(b, omit_move);
    }

    pair<double,U16> v = {-20000,0};
    for(auto m:moveset){
        if(time_up)
        {
            return {0.0,0};
        }

        auto time_now = chrono::high_resolution_clock::now();
        double duration = chrono::duration_cast<std::chrono::milliseconds>(time_now - start_time).count();
        if(duration >= time_given)
        {
            time_up = true;
            return {0.0,0};
        }

        Board* tempb = new Board(b);
        tempb->do_move_(m.second);
        int tt = -1;

        if(depth == 4){
            first_move = m.second;
        }
        pair<double,U16> p = {getMin(*tempb,alpha,beta,depth+tt,m.second,qsearch,0).first,m.second};

        v = max(v,p);
        alpha = max(alpha,p.first);
        delete(tempb);
        if(alpha>beta){
            return v;
        }
    }


    if(moveset.size()==0)
    {
        if(!b.in_check())
            v.first = 0;
        else
        {
            v.first = -15000.0;
            v.first -= depth*10;
        }
    }


    return v;
}

double evaluate(const Board &b) {
    return Evaluation(b);
}


